from typing import Dict, Any

def merge_dicts(*dicts: Dict[str, Any]) -> Dict[str, Any]:
    """
    Merge multiple dictionaries into a single dictionary.

    Later dictionaries override earlier ones on key conflicts.
    None values are handled gracefully by treating None dictionaries as empty.

    Args:
        *dicts: Variable number of dictionaries to merge.

    Returns:
        A new dictionary containing the merged result.

    Raises:
        TypeError: If any non-None argument is not a dictionary.

    Examples:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {'a': 1, 'b': 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {'a': 2}
        >>> merge_dicts({"a": 1}, None, {"b": 2})
        {'a': 1, 'b': 2}
    """
    result: Dict[str, Any] = {}

    for d in dicts:
        # Handle None gracefully
        if d is None:
            continue

        # Type check for non-None values
        if not isinstance(d, dict):
            raise TypeError(
                f"Expected dict or None, got {type(d).__name__}: {d!r}"
            )

        # Merge the dictionary
        result.update(d)

    return result


# Test cases for edge cases
if __name__ == "__main__":
    # Basic merge
    assert merge_dicts({"a": 1}, {"b": 2}) == {"a": 1, "b": 2}

    # Override behavior
    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}

    # Multiple dictionaries with mixed overrides
    assert merge_dicts(
        {"a": 1, "b": 2},
        {"b": 3, "c": 4},
        {"c": 5, "d": 6}
    ) == {"a": 1, "b": 3, "c": 5, "d": 6}

    # Handle None gracefully
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}
    assert merge_dicts(None, {"a": 1}, None) == {"a": 1}
    assert merge_dicts(None, None) == {}

    # Empty dictionaries
    assert merge_dicts({}, {}) == {}
    assert merge_dicts({}, {"a": 1}) == {"a": 1}
    assert merge_dicts({"a": 1}, {}) == {"a": 1}

    # Single dictionary
    assert merge_dicts({"a": 1, "b": 2}) == {"a": 1, "b": 2}

    # No arguments
    assert merge_dicts() == {}

    # Complex values (lists, nested dicts, etc.)
    assert merge_dicts(
        {"a": [1, 2], "b": {"x": 1}},
        {"a": [3, 4], "c": 5}
    ) == {"a": [3, 4], "b": {"x": 1}, "c": 5}

    # None as values in dictionaries
    assert merge_dicts(
        {"a": None, "b": 2},
        {"b": None, "c": 3}
    ) == {"a": None, "b": None, "c": 3}

    # Error handling: non-dict argument
    try:
        merge_dicts({"a": 1}, "not a dict")
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "Expected dict or None" in str(e)

    # Error handling: list instead of dict
    try:
        merge_dicts([1, 2, 3])
        assert False, "Should have raised TypeError"
    except TypeError as e:
        assert "Expected dict or None" in str(e)

    print("All tests passed!")
